import './master.css';
import React from 'react';

const ResultContainer = (props) => {
  let retval = [];
  let len = props.children.length;

  for(let i = 0; i < len; i += 4){
    let cols = [];
    for(let j = i; j < (i+4 < len ? i+4 : len); j += 2){
      let temp = [];
      for(let k = j; k < (j+2 < len ? j+2 : len); k++){
        temp.push(props.children[k])
      }
      cols.push(
        <div className="col-12 col-sm-6  d-flex flex-row justify-content-around" key={i}>
          {temp}
        </div>
      )
    }
    retval.push(
      <div className="row d-flex flex-row justify-content-between mb-5" key={i}>
        {cols}
      </div>
    );
  }

  return (
    <React.Fragment>
      {retval}
    </React.Fragment>
  );
};

export default ResultContainer;
